  false,\n\t\"url\": null,\n\t\"notes\": \"In this paper we review nesting sea duck
  population declines in Alaska during the last several decades and explore the possibility
  that contaminants may be implicated. Aerial surveys of the surf scoter (Melanitta
  perspicillata), white-winged scoter (M. fusca), black scoter (M. niqra), oldsquaw
  (Clanqula hyemalis), spectacled eider (Somateria fischeri), and Stelleru2019s eider
  (Polysticta stelleri) show long-term breeding population declines, especially the
  latter three species. The spectacled eider was recently classified as u201cThreatenedu201d
  under the Endangered Species Act. In addition, three other diving ducks (common
  goldeneye Bucephala clangula, Barrow's goldeneye B. islandica, and bufflehead B.
  albeola) which commonly winter in coastal areas have declined from unknown causes.
  Large die offs of all three species of scoters during molt, a period of high energy
  demand, were documented in August 1990, 1991, and 1992 at coastal reefs in southeastern
  Alaska. There was no evidence of infectious diseases in these scoters. These die
  offs may or may not be associated with the long-term declines. Many scoters contained
  elevated renal concentrations of cadmium thigh of 375 ug/g dry weight [DW]). Interpretation
  of cadmium residues in sea ducks is not well understood because of the potential
  interaction of many metals. Selenium concentrations in livers of nesting white-winged
  scoters were high: however, the eggs they laid contained low selenium concentrations
  compared to expected values derived from relationships for freshwater bird species.
  Histological evaluation of livers found a high prevalence of hepatocellular vacuolation
  (49%), a degenerative change frequently associated with sublethal toxic insult.
  Cadmium and selenium mean liver concentrations were generally higher in those birds
  with more severe vacuolation however; the relationships were not statistically significant.
  To date, we do not know if sea duck population declines are related to metals or
  other contaminants. A strategy for future research is discussed.\",\n\t\"owner_org\":
